insert into FILMS (NAME, DESCRIPTION, GENRE_ID, DURATION, RELEASE_DATE, IMAGE) values ('Зеленая миля','Пол Эджкомб — начальник блока смертников в тюрьме «Холодная гора», каждый из узников которого однажды проходит «зеленую милю» по пути к месту казни. Пол повидал много заключённых и надзирателей за время работы. Однако гигант Джон Коффи, обвинённый в страшном преступлении, стал одним из самых необычных обитателей блока.',2,189,'1999-12-06','');
insert into FILMS (NAME, DESCRIPTION, GENRE_ID, DURATION, RELEASE_DATE, IMAGE) values ('Мстители','Локи, сводный брат Тора, возвращается, и в этот раз он не один. Земля оказывается на грани порабощения, и только лучшие из лучших могут спасти человечество. Глава международной организации Щ.И.Т. Ник Фьюри собирает выдающихся поборников справедливости и добра, чтобы отразить атаку. Под предводительством Капитана Америки Железный Человек, Тор, Невероятный Халк, Соколиный Глаз и Чёрная Вдова вступают в войну с захватчиком.',9,137,'2012-04-11','');
insert into FILMS (NAME, DESCRIPTION, GENRE_ID, DURATION, RELEASE_DATE, IMAGE) values ('Побег из Шоушенка','Бухгалтер Энди Дюфрейн обвинён в убийстве собственной жены и её любовника. Оказавшись в тюрьме под названием Шоушенк, он сталкивается с жестокостью и беззаконием, царящими по обе стороны решётки. Каждый, кто попадает в эти стены, становится их рабом до конца жизни. Но Энди, обладающий живым умом и доброй душой, находит подход как к заключённым, так и к охранникам, добиваясь их особого к себе расположения.',2,142,'1994-09-10', '');
insert into FILMS (NAME, DESCRIPTION, GENRE_ID, DURATION, RELEASE_DATE, IMAGE) values ('Темный рыцарь','Бэтмен поднимает ставки в войне с криминалом. С помощью лейтенанта Джима Гордона и прокурора Харви Дента он намерен очистить улицы Готэма от преступности. Сотрудничество оказывается эффективным, но скоро они обнаружат себя посреди хаоса, развязанного восходящим криминальным гением, известным напуганным горожанам под именем Джокер.',9,152,'2008-07-14','');
insert into FILMS (NAME, DESCRIPTION, GENRE_ID, DURATION, RELEASE_DATE, IMAGE) values ('Властелин колец: Возвращение короля','Повелитель сил тьмы Саурон направляет свою бесчисленную армию под стены Минас-Тирита, крепости Последней Надежды. Он предвкушает близкую победу, но именно это мешает ему заметить две крохотные фигурки — хоббитов, приближающихся к Роковой Горе, где им предстоит уничтожить Кольцо Всевластья.',7,201,'2003-12-01','');
insert into FILMS (NAME, DESCRIPTION, GENRE_ID, DURATION, RELEASE_DATE, IMAGE) values ('Один дома', 'Американское семейство отправляется из Чикаго в Европу, но в спешке сборов бестолковые родители забывают дома... одного из своих детей. Юное создание, однако, не теряется и демонстрирует чудеса изобретательности. И когда в дом залезают грабители, им приходится не раз пожалеть о встрече с милым крошкой.',1,103,'1990-11-10','');
insert into FILMS (NAME, DESCRIPTION, GENRE_ID, DURATION, RELEASE_DATE, IMAGE) values ('Аладдин', 'В славном граде Аграба живёт Аладдин, веселый воришка с золотым сердцем. Живёт и не знает, что вскоре его ждёт величайшее приключение в жизни. Ведь только с его помощью чёрный маг Джафар может овладеть невероятным сокровищем — лампой, в которой заключён исполняющий желания могущественный Джинн. И только хитроумие, смекалка и доброта Аладдина и его друзей — обезьянки Абу, принцессы Жасмин и самого Джинна - способны помешать Джафару завладеть лампой и захватить власть над миром.',3,90,'1992-11-8','');
insert into FILMS (NAME, DESCRIPTION, GENRE_ID, DURATION, RELEASE_DATE, IMAGE) values ('Бойцовский клуб', 'Сотрудник страховой компании страдает хронической бессонницей и отчаянно пытается вырваться из мучительно скучной жизни. Однажды в очередной командировке он встречает некоего Тайлера Дёрдена — харизматического торговца мылом с извращенной философией. Тайлер уверен, что самосовершенствование — удел слабых, а единственное, ради чего стоит жить, — саморазрушение. Проходит немного времени, и вот уже новые друзья лупят друг друга почем зря на стоянке перед баром, и очищающий мордобой доставляет им высшее блаженство. Приобщая других мужчин к простым радостям физической жестокости, они основывают тайный Бойцовский клуб, который начинает пользоваться невероятной популярностью.',4,139,'1999-09-10','');
insert into FILMS (NAME, DESCRIPTION, GENRE_ID, DURATION, RELEASE_DATE, IMAGE) values ('Сенна', 'Рассказ об одном из лучших гонщиков за всю историю Формулы-1, о великом спортсмене и человеке, который мог творить настоящие чудеса на гоночных трассах и оставаться при этом человеком с большой буквы. Это история о неповторимом Волшебнике - Айртоне Сенне.',5,106,'2010-10-07','');
insert into FILMS (NAME, DESCRIPTION, GENRE_ID, DURATION, RELEASE_DATE, IMAGE) values ('Джон Уик', 'Джон Уик - на первый взгляд, самый обычный среднестатистический американец, который ведет спокойную мирную жизнь. Однако мало кто знает, что он был наёмным убийцей, причём одним из лучших профессионалов в своём деле. После того как сынок главы бандитской группы со своими приятелями угоняет его любимый «Мустанг» 1969 года выпуска, при этом убив его собаку Дейзи, которая была подарком недавно почившей супруги, Джон вынужден вернуться к своему прошлому. Теперь Уик начинает охоту за теми, кто имел неосторожность перейти ему дорогу, и он готов на всё, чтобы отомстить.',6,101,'2014-09-19','');
insert into FILMS (NAME, DESCRIPTION, GENRE_ID, DURATION, RELEASE_DATE, IMAGE) values ('Пила: Игра на выживание', 'Два незнакомца просыпаются в подвале, где лежит человек с простреленной головой и пистолетом в руке. Они прикованы к стенам цепями и не помнят, как тут оказались. Голос с найденной плёнки велит одному из них выбрать — убить товарища по несчастью или дать умереть своим жене и дочери. Так начинается жестокая игра, у невольных участников которой есть всего лишь 7 часов.',8,103,'2004-01-19','');
